import Navbar from "./Components/Navbar";
import Search from "./Components/Search";
import Products from "./Components/Products";
import About from "./Components/About";
import Footer from "./Components/Footer";

function App() {
  return (
    <>
      <Navbar></Navbar>
      <Search></Search>
      <Products></Products>
      <About></About>
      <Footer></Footer>
    </>
  );
}
 export default App
